class test_afsk_mod_bf(gr_unittest.TestCase):

    def setUp(self):
        self.tb = gr.top_block()

    def tearDown(self):
        self.tb = None

    def test_afsk_mod_bf_packed_MSB(self):
        src = blocks.vector_source_b(bytes_in)
        op = digital.afsk_mod_bf(
            samp_rate, freq_zero, freq_one, bit_rate, False, endianness_t.GR_MSB_FIRST)
        dst = blocks.vector_sink_f()

        self.tb.connect(src, op)    # vector source ---> AFSK-Modulator
        self.tb.connect(op, dst)    # AFSK Mod ---> vector sink
        self.tb.run()               # run the graph and wait for it to finish

        actual_result = dst.data()  # fetch the contents of the sink
        # print(f"actual result: {actual_result}")
        # print(f"expected result: {MSB_out}")
        self.assertFloatTuplesAlmostEqual(MSB_out, actual_result)

    def test_afsk_mod_bf_packed_LSB(self):
        src = blocks.vector_source_b(bytes_in)
        op = digital.afsk_mod_bf(
            samp_rate, freq_zero, freq_one, bit_rate, False, endianness_t.GR_LSB_FIRST)
        dst = blocks.vector_sink_f()

        self.tb.connect(src, op)
        self.tb.connect(op, dst)
        self.tb.run()

        actual_result = dst.data()
        expected_result = LSB_out
        # print(f"actual result: {actual_result}")
        # print(f"expected result: {LSB_out}")
        self.assertFloatTuplesAlmostEqual(expected_result, actual_result)

    def test_afsk_mod_bf_unpacked(self):
        src = blocks.vector_source_b(bits_in)
        op = digital.afsk_mod_bf(
            samp_rate, freq_zero, freq_one, bit_rate, True, endianness_t.GR_MSB_FIRST)
        dst = blocks.vector_sink_f()

        self.tb.connect(src, op)
        self.tb.connect(op, dst)
        self.tb.run()

        actual_result = dst.data()
        # print(f"actual result: {actual_result}")
        # print(f"expected result: {MSB_out}")
        self.assertFloatTuplesAlmostEqual(MSB_out, actual_result)


if __name__ == '__main__':
    gr_unittest.run(test_afsk_mod_bf)
